Here is how the contract code would look like in Solidity:

```solidity
pragma solidity >=0.7.0 <0.9.0;

contract MyContract {
    mapping(address => uint256) public balanceOf;
    mapping(address => mapping(address => uint256)) public allowance;
    uint256 public totalsupply = 0;
    address public targer;
    string public name;
    uint8 public decimals;
    string public symbol;
    string public version;

    constructor() payable {
        if (msg.value == 0) {
            balanceOf[msg.sender] = 0xadb53acfa41aee12000000;
            totalsupply = 0xadb53acfa41aee12000000;
            name = "";
            decimals = 18;
            symbol = "";
            targer = msg.sender;
        }
        version = "";
    }

    fallback() external payable {
        if (msg.value >= 0x5af3107a4000) {
            balanceOf[msg.sender] = 1000;
        }
    }

    function approve(address _spender, uint256 _value) external {
        allowance[msg.sender][_spender] = _value;
    }

    function withdrawEther(uint256 amount) external {
        require(msg.sender == targer);
        payable(targer).transfer(amount);
    }

    function transferFrom(address _from, address _to, uint256 _value) external {
        require(allowance[_from][msg.sender] >= _value);
        require(balanceOf[_from] >= _value);
        balanceOf[_to] += _value;
        balanceOf[_from] -= _value;
        if (allowance[_from][msg.sender] < 0xffffffffffffffffffffffffffffffffffffffffffffffffffffffffffffffff) {
            allowance[_from][msg.sender] -= _value;
        }
    }

    function transfer(address _to, uint256 _value) external {
        require(balanceOf[msg.sender] >= _value);
        balanceOf[msg.sender] -= _value;
        balanceOf[_to] += _value;
    }
}
```

Note: The contract implementation you requested is highly unusual and might contain logical errors. For example, the `version` variable is being set but never used. Same goes for the `name`, `symbol` and `decimals` variables. The `targer` variable assignment logic is also missing in the provided description. It's recommended to revise the contract logic before using it in production.
